import React from 'react';
import './about-us.scss';

const AboutUs = () => {
    return (
        <div className="about-us mt-5">
            <div className="row">
                <div className="col-12">
                    <h3 className="text-center">ABOUT US</h3>
                </div>
            </div>
        </div>
    )
}

export default AboutUs;
